import React, { useState } from 'react';
import "./Report.css"
function Report(){
  return(
    <div className='Report-container'>
    <ul>
      <li><a href="/Accidentform">Accident
      <i class="fa fa-road" aria-hidden="true" align="center"></i></a></li>
      <li><a href="/Hazardform">Hazard</a></li>
      <li><a href="/Trafficform">Traffic</a></li>
    </ul>
    </div>
  )
}
export default Report
